    tokenAtendido = jwt.encode({'entity': 'Subsecretaría General de La Presidencia',
                        'run':'11111111',
                        'expiration': exp,
                        'purpose':'Propósito General'},
                        'abcd', algorithm='HS256').decode('utf-8')


    def encrypt_string(pdf):
        checksum256 = \
            hashlib.sha256(pdf.encode()).hexdigest()
        return checksum256

    checksum = encrypt_string(pdfb64)
    #checksum='cf4e9e385cb1daf0c35bf4bb035c2fefb77ae2e432a3e45c4f8bf2d1174d62ff'


